import React from 'react';
import { ActivityIcon, DisplayName, ImageWrapper, ProfileTabContainer} from './profile-tab.styles';
import CustomButton from '../custom-button/custom-button.component';



const ProfileTab = ({user, handleClick}) => {

    const {activityStatus, displayIcon, displayName='N/A'} = user;
    console.log("User: ", user);
    console.log("What's my activity Status? ", activityStatus);


    return <ProfileTabContainer activityStatus={activityStatus}>
        <ImageWrapper>
            <img alt='default-profile'  width='50' height='50' src={displayIcon}/>
        </ImageWrapper>
        <span>{displayName}</span>
        <ActivityIcon activityStatus={activityStatus}/>
        <CustomButton onClick={handleClick} isProfileStyles>View Profile</CustomButton>
    </ProfileTabContainer>
}

export default ProfileTab;
